import React from "react"
import Searchbar from "./Searchbar"
import Foodcard from "./Foodcard"
import { foodmenu } from "../utlis/data"

const Food = () => {
  return (
    <div className="food">
      <Searchbar />
      {foodmenu.map(item => (
        <Foodcard
          heading={item.name}
          ingredients={item.indrignts.map(item => item)}
          desc={item.desc}
          process={item.process.map(item => item)}
        />
      ))}
    </div>
  )
}
export default Food
